                  culinary creativity to life!
                </p>
                <div className="cta-buttons">
                  <button className="curved-btn ">Join</button>
                  <button className="">{PLa}</button>
                </div>
              </div>
            </div>
            <div>
              {" "}
              <img src={heroImg} alt="hero-img"></img>
            </div>
          </div>
        </div>
      </section>
    </main>
  );
}

export default HomePage;
